import { BrowserRouter as Router } from "react-router-dom";
import Routes from "./routes/PageRoutes";
import CenterBox from "./layout/CenterBox";
const [messages, setMessages] = useState([]);

function App() {
  return (
    <>
      <CenterBox>
        <Router>
          <Routes />
        </Router>
      </CenterBox>
    </>
  );
}

export default App;
